  	var myEvent = new Event('resize'); // 创建一个支持冒泡且不能被取消的resize事件
    window.dispatchEvent(myEvent); // 事件可以在任何元素触发
		});
		},
			changeHref:function (sortnum){
      switch(sortnum){
        case 1:
        this.$router.push({
          path: "/simulate1"
        });
        break;
        case 2:
					this.$router.push({
          path: "/simulate2",
        });
        break;
				case 3:this.$router.push({
          path: "/simulate3",
        });
        break;
				case 4:this.$router.push({
          path: "/simulate4",
        });
        break;

				
			}
		},

    	 begin1() {
                // 点击按钮后开始计算指定长度的时间
                this.time = (Date.parse(new Date()) + ((1/30 * 60 * 60)) * 1000);
                // 开始执行倒计时
                this.countdown1();
                // 更换按钮，根据情况选择v-if或v-show
                this.isshow11 = false;
							//	this.$message({
                //    type: 'success',
                  //  message: '开始答题'
               // });

            },
						countdown1() {
                const end = this.time; // 定义结束时间
                const now = Date.parse(new Date()); // 获取本地时间
                const msec = end - now; // 定义总共所需的时间
                // 将时间戳进行格式化
                let hr1 = parseInt(msec / 1000 / 60 / 60 % 24);
                let min1= parseInt(msec / 1000 / 60 % 60);
                let sec1 = parseInt(msec / 1000 % 60);
                // 倒计时结束时的操作
                const that = this;
                if (this.hr1 == 0 && this.min1 == 0 && this.sec1 == 0) {
                    console.log('时间已经结束，答题完毕');
                    this.hr1 = 0;
                    this.min1 = 10;
                    this.sec1 = 0;
                } else {
                    // 如时间未归零则继续在一秒后执行
                    this.hr1 = hr1 > 9 ? hr1 : '0' + hr1;
                    this.min1 = min1 > 9 ? min1 : '0' + min1;
                    this.sec1 = sec1 > 9 ? sec1 : '0' + sec1;
                    setTimeout(that.countdown1, 1000)
                }
            },

						stop1() {
                this.$confirm('即将结束答题, 是否继续?', '提示', {
                    confirmButtonText: '确定',
                    cancelButtonText: '取消',
                    type: 'warning'
                }).then((action) => {
                    // eleUI的确定结束回调函数方法
                    if (action === 'confirm') {
                        this.hr1 = 0;
                        this.min1 = 0;
                        this.sec1 = 0;
                        console.log(this.hr1 + ',' + this.min1 + ',' + this.sec1);
                        this.isshow11 = true;
                    }
                    this.$message({
                        type: 'success',
                        message: '交卷成功!'
                    });
										this.submit1();
                }).catch(() => {
                    // 点击取消后
                    this.$message({
                        type: 'info',
                        message: '已取消交卷'
                    });

                });

            },
		 
     submit1() {
      //这部分应该是保存提交你添加的内容
			var a=0;
			for(var i=0;i<5;i++)
			{
				if(this.transData1[i][1]==this.ruleData1[i])
				{
					a=a+1;
				}
				else{
					a=a-1;
				}
			}
			if(a==5)
			{
			 this.$message({
          message: '答案正确',
          type: 'success'
        });
				this.show11=true;
				this.show21=false;
				this.show31=true;
			}
			else{
				 this.$message({
          message: '答案错误',
          type: 'error'
        });
				this.show11=false;
				this.show21=true;
				this.show31=true;
			}
			this.$nextTick(function () {
  	var myEvent = new Event('resize'); // 创建一个支持冒泡且不能被取消的resize事件
    window.dispatchEvent(myEvent); // 事件可以在任何元素触发
});

		 },
		
  },
};
